import "./Home.css";
import Navbar from "../../Components/Navbar/Navbar";
import Homepage from "../../Components/Homepage/Homepage";
import Button from "../../Components/Button/Button";
import Form from "../../Components/Form/Form";

export default function Home() {
  return (
    <div>
      <Navbar />
      <Homepage />
      <div className="form">
        <Form type="text" name="First_Name" place="Type your FirstName" class='label1' /><br></br>
        <Form type="text" name="Last_Name" place="Type your LastName" />
        <Form type="number" name="Age" place="Your Age" />
        <Form type="email" name="Email" place="example@gmail.com" />
        <Form type="password" name="Password" place="....password" />
        <Button name="Click" />
      </div>
    </div>
  );
}
